import React from 'react';
import classes from '../VideoCard/VideoCard.module.css';


const VideoCard = (props) =>{
return(
    <div className={classes.VideoCard} >
    
    <h3 className ={classes.Title}>{props.id}</h3>
    <h3 className ={classes.Title}>{props.customerName}</h3>
    <h3 className ={classes.Title}>{props.orderDate}</h3>
    <h3 className ={classes.Title}>{props.orderTime}</h3>
    <h3 className ={classes.Title}>{props.amount}</h3>
    <h3 className ={classes.Title}>{props.orderStatus}</h3>
    </div>
)
}
export default VideoCard;
